var title_f29_10_29861="Intra-aortic balloon inflation and deflation timing";
var content_f29_10_29861=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F83948&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F83948&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 489px\">",
"   <div class=\"ttl\">",
"    Intra-aortic balloon inflation and deflation timing",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 469px; height: 560px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The timing of balloon inflation and deflation is adjusted in the 1:2 mode. The inflation point is moved rightward (later) until it occurs in late diastole, and the dicrotic notch is uncovered. The inflation timing is moved progressively earlier in the cardiac cycle until the dicrotic notch on the central aortic tracing just disappears. Examples of early, late, and correct inflation are shown in the top two tracings. Similarly, the deflation knob is moved leftward (earlier) and then slowly advanced toward the right (later in the cardiac cycle) until the end-diastolic pressure dips 10 to 15 mmHg below the patient's unassisted diastolic pressure. This will produce a maximal lowering of the patient's unassisted systolic pressure. Examples of early, late, and correct deflation timing are shown in the bottom two traces.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Burkhof D. Intra-Aortic Balloon Counterpulsation and Other Circulatory Assist Devices. In: Grossman's Cardiac Catheterization, Angiography, &amp; Intervention, 7th ed, Baim DS (Ed), Lippincott Williams &amp; Wilkins, Philadelphia 2006. Copyright &copy; 2006 Lippincott Williams &amp; Wilkins.",
"    </div>",
"    <div class=\"contractual\">",
"     <br/>",
"     <a href=\"file://www.lww.com\">",
"      file://www.lww.com",
"     </a>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
