var title_f29_10_29863="Deep fascial spaces of the hand";
var content_f29_10_29863=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=SURG%2F77205&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=SURG%2F77205&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Deep fascial spaces of the hand",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 439px; height: 602px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The palm has three potential closed spaces with well defined anatomical borders; the thenar, mid palmar, and the hypothenar space. These spaces are deep to the flexor tendons but superficial to the interosseous muscles. Infections in these spaces occur following a penetrating injury in most cases and occasionally as an extension from a subcutaneous abscess or adjacent pyogenic flexor tenosynovitis.",
"    <br>",
"     Panel A demonstrates the deep spaces of the palmar aspect of the hand.",
"     <br>",
"      Panel B demonstrates the extent of the deep palmar spaces of the hand.",
"      <div class=\"footnotes\">",
"      </div>",
"      <div class=\"reference\">",
"      </div>",
"     </br>",
"    </br>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
