var title_f29_10_29866="Mortality HTN under 65 years";
var content_f29_10_29866=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEPH%2F62430%7ENEPH%2F57839&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEPH%2F62430%7ENEPH%2F57839&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Joint effect of systolic and diastolic blood pressure on mortality",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 406px; height: 364px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Among participants in the NHANES II who were &lt;65 years of age, the figure shows a three dimensional surface representing the relative risk for all-cause mortality (vertical axis) with different combinations of the diastolic blood pressure (right diagonal arrow axis) and the systolic blood pressure (left diagonal arrow axis). For a fixed diastolic blood pressure, for example, the effect of different systolic blood pressures can be evaluated by following the risk surface along lines parallel to the systolic blood pressure axis. This effect is known as the conditional effect of systolic blood pressure. Similarly, for a fixed systolic blood pressure, the conditional effect of diastolic blood pressure can be evaluated by following the risk surface along lines parallel to the diastolic blood pressure axis.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Redrawn from: Pastor-Barriuso R, et al. Ann Intern Med 2003; 139:731.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 479px\">",
"   <div class=\"ttl\">",
"    Joint effect of systolic and diastolic blood pressure on mortality",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 459px; height: 396px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Among participants in the NHANES II who were &ge;65 years of age, the figure shows a three dimensional surface representing the relative risk for all-cause mortality (vertical axis) with different combinations of the diastolic blood pressure (right diagonal arrow axis) and the systolic blood pressure (left diagonal arrow axis). For a fixed diastolic blood pressure, for example, the effect of different systolic blood pressures can be evaluated by following the risk surface along lines parallel to the systolic blood pressure axis. This effect is known as the conditional effect of systolic blood pressure. Similarly, for a fixed systolic blood pressure, the conditional effect of diastolic blood pressure can be evaluated by following the risk surface along lines parallel to the diastolic blood pressure axis.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Redrawn from: Pastor-Barriuso R, et al. Ann Intern Med 2003; 139:731.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
