"       </td>",
"       <td>",
"        1.30, 1.44",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Prolonged standing (&gt;3 hours/day)",
"       </td>",
"       <td>",
"        1.26",
"       </td>",
