"       </td>",
"       <td>",
"        1.06, 1.46",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Long working hours",
"       </td>",
"       <td>",
"        1.03",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        0.92, 1.16",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        High cumulative work fatigue score",
"       </td>",
"       <td>",
"        1.63",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        1.33, 1.98",
