var title_f29_10_29868="Enuresis history";
var content_f29_10_29868=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F68994&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F68994&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Important aspects of the history for a child with enuresis",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Historical feature",
"       </td>",
"       <td class=\"subtitle1\">",
"        Possible significance",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Daytime symptoms",
"       </td>",
"       <td>",
"        Dysfunctional voiding",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Lower urinary tract symptoms (voiding &ge;8 or &le;3 times per day, hesitancy, straining, weak stream, intermittent stream, incomplete emptying, postmicturation dribble, genital or lower urinary tract pain)",
"       </td>",
"       <td>",
"        Dysfunctional voiding or anatomic abnormality (eg, posterior urethral valves)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Prolonged period of dryness (&gt;6 months)",
"       </td>",
"       <td>",
"        Secondary enuresis more often associated with psychologic comorbidities",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Frequency of episodes",
"       </td>",
"       <td>",
"        Nightly enuresis is associated with poor prognosis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Change in frequency of episodes over time",
"       </td>",
"       <td>",
"        The natural history is of spontaneous resolution",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Approximate volume of enuretic void",
"       </td>",
"       <td>",
"        Estimate of bladder capacity",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Fluid intake diary",
"       </td>",
"       <td>",
"        May suggest etiology of nocturnal polyuria (increased afternoon/evening fluid intake; diabetes mellitus; diabetes insipidus; psychogenic polydipsia)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Stooling history",
"       </td>",
"       <td>",
"        Constipation may contribute to decreased bladder capacity",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Review of systems",
"       </td>",
"       <td class=\"sublist1_start\">",
"        May identify previously undiagnosed medical condition that contributes to enuresis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        - Snoring",
"       </td>",
"       <td class=\"sublist1\">",
"        - Obstructive sleep apnea",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        - Weight loss, fatigue",
"       </td>",
"       <td class=\"sublist1\">",
"        - Diabetes, kidney disease",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        - Gait abnormalities",
"       </td>",
"       <td class=\"sublist1\">",
"        - Spinal dysraphism",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        - Staring spells",
"       </td>",
"       <td class=\"sublist1\">",
"        - Seizure disorder",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        - Perianal itching, vulvovaginitis",
"       </td>",
"       <td class=\"sublist1\">",
"        - Pinworms",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        - Excessive thirst, nighttime drinking",
"       </td>",
"       <td class=\"sublist1\">",
"        - Diabetes, kidney disease, psychogenic polydipsia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Family history of enuresis",
"       </td>",
"       <td>",
"        Genetic factors may be contributing",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
