var title_f29_10_29870="OCEANS gyn protocol";
var content_f29_10_29870=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ONC%2F87827&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ONC%2F87827&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Carboplatin and gemcitabine plus bevacizumab chemotherapy for platinum-sensitive recurrent epithelial carcinoma of the ovary, peritoneum, or fallopian tube",
"    <sup>",
"     [1]",
"    </sup>",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup span=\"4\" width=\"25%\">",
"     </colgroup>",
"     <tbody>",
"      <tr class=\"divider_bottom\">",
"       <td colspan=\"4\">",
"        Cycle length: 21 days.",
"        <br/>",
"        Total cycles: 6 to 10.",
"        <br/>",
"        (Following completion of chemotherapy, single agent bevacizumab maintenance therapy may be continued on an every three week schedule until disease progression or toxicity)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Drug",
"       </td>",
"       <td class=\"subtitle1\">",
"        Dose and route",
"       </td>",
"       <td class=\"subtitle1\">",
"        Administration",
"       </td>",
"       <td class=\"subtitle1\">",
"        Given on days",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Carboplatin",
"        </strong>",
"       </td>",
"       <td>",
"        AUC* = 4 mg/mL per min IV",
"       </td>",
"       <td>",
"        Dilute in 250 mL normal saline (NS)",
"        <sup>",
"         &Delta;",
"        </sup>",
"        and administer over one hour.",
"       </td>",
"       <td>",
"        Day 1",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Gemcitabine",
"        </strong>",
"       </td>",
"       <td>",
"        1000 mg/m",
"        <sup>",
"         2",
"        </sup>",
"        IV",
"       </td>",
"       <td>",
"        Dilute in 250 mL NS and administer over 30 minutes.",
"       </td>",
"       <td>",
"        Days 1 and 8",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Bevacizumab",
"        </strong>",
"       </td>",
"       <td>",
"        15 mg/kg IV",
"       </td>",
"       <td>",
"        Dilute into a total volume of 100 mL NS",
"        <sup>",
"         &Delta;",
"        </sup>",
"        . Administer first dose over 90 minutes, before carboplatin and gemcitabine. If well tolerated, the second infusion may be administered over 60 minutes. If well tolerated, all subsequent infusions may be administered over 30 minutes",
"        <sup>",
"         &loz;[2]",
"        </sup>",
"        .",
"       </td>",
"       <td>",
"        Day 1",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"4\">",
"        Pretreatment considerations:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Emesis risk:",
"        </strong>",
"        MODERATE on day 1. LOW on day 8. Refer to UpToDate topic on \"Prevention and treatment of chemotherapy-induced nausea and vomiting\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Prophylaxis for infusion reactions:",
"        </strong>",
"        There is no standard premedication regimen. Refer to UpToDate topic on \"Infusion reactions to systemic chemotherapy\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Vesicant/irritant properties:",
"        </strong>",
"        Carboplatin and gemcitabine are irritants. Refer to UpToDate topic \"Extravasation injury from chemotherapy and other non-neoplastic vesicants\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Infection prophylaxis:",
"        </strong>",
"        Primary prophylaxis with G-CSF is not indicated (risk of febrile neutropenia &lt;2 percent)",
"        <sup>",
"         [1]",
"        </sup>",
"        . Refer to UpToDate topic on \"Use of granulocyte colony stimulating factors in patients with chemotherapy-induced neutropenia\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Dose adjustment for baseline liver or renal dysfunction:",
"        </strong>",
"        Each carboplatin dose should be calculated based upon renal function by use of the Calvert formula*. A lower starting dose for gemcitabine may be needed in patients with liver impairment. Refer to UpToDate topic \"Chemotherapy hepatotoxicity and dose modification in patients with liver disease\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"4\">",
"        Monitoring parameters:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull; CBC with differential prior to treatment on days 1 and 8.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull; Assess electrolytes and liver and renal function prior to each new cycle of treatment.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull; Assess changes in neurologic function, blood pressure, and risk for bleeding prior to each new cycle of treatment. Urine protein/creatinine ratio should be obtained when appropriate.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"4\">",
"        Suggested dose modifications for toxicity:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        <p>",
"         &bull;",
"         <strong>",
"          Myelotoxicity:",
"         </strong>",
"         For initiation of each new treatment cycle, ANC &ge;1500 cells/mm",
"         <sup>",
"          3",
"         </sup>",
"         , hemoglobin (Hb) &ge;8.5 g/dL, and platelet count &ge;100,000/mm",
"         <sup>",
"          3[1]",
"         </sup>",
"         . For treatment on day 8, ANC &ge;500 cells/mm",
"         <sup>",
"          3",
"         </sup>",
"         , Hb &ge;8.0 g/dL, and platelet count &ge;75,000/mm",
"         <sup>",
"          3",
"         </sup>",
"         . If day 8 ANC 1000 to 1499 cells/mm",
"         <sup>",
"          3",
"         </sup>",
"         and/or platelets 75,000 to 99,999/mm",
"         <sup>",
"          3",
"         </sup>",
"         , reduce gemcitabine dose by 50 percent. If day 8 ANC &lt;1000 cells/mm",
"         <sup>",
"          3",
"         </sup>",
"         and/or platelets &lt;75,000/mm",
"         <sup>",
"          3",
"         </sup>",
"         , omit gemcitabine dose",
"         <sup>",
"          3",
"         </sup>",
"         .",
"        </p>",
"        <p>",
"         For intracycle febrile neutropenia, ANC &lt;500 cells/mm",
"         <sup>",
"          3",
"         </sup>",
"         for more than five days, ANC &lt;100/mm",
"         <sup>",
"          3",
"         </sup>",
"         for more than three days, or any platelet count &lt;25,000/mm",
"         <sup>",
"          3",
"         </sup>",
"         , reduce gemcitabine dose to 800 mg/m",
"         <sup>",
"          2",
"         </sup>",
"         for both days 1 and 8. If toxicities recur despite dose reduction, permanently delete the day 8 gemcitabine dose.",
"        </p>",
"        Discontinue carboplatin and gemcitabine if hematologic recovery does not occur within three weeks.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Hypertension:",
"        </strong>",
"        A meta-analysis of almost 13,000 patients reported that bevacizumab was associated with a 24 percent incidence of hypertension with severe hypertension reported in 8 percent",
"        <sup>",
"         [3]",
"        </sup>",
"        . Patients should be actively monitored for high blood pressure during treatment and anti-hypertensive medication initiated to maintain blood pressure &lt;140/90. Refer to UpToDate topic on \"Choice of therapy in essential hypertension: Recommendations\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Hemolytic-uremic syndrome (HUS):",
"        </strong>",
"        In clinical trials, HUS was reported in 0.25 percent of patients receiving gemcitabine",
"        <sup>",
"         [2]",
"        </sup>",
"        . Consider diagnosis if the patient develops hemolysis and severe thrombocytopenia, with or without renal failure or central nervous system findings. Discontinue gemcitabine immediately and permanently. Refer to UpToDate topic on \"Causes of thrombotic thrombocytopenic purpura-hemolytic uremic syndrome in adults\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Nephrotoxicity:",
"        </strong>",
"        Alterations in renal function during therapy may require a recalculation of the carboplatin dose. Refer to UpToDate topic on \"Chemotherapy-related nephrotoxicity and dose modification in patients with renal insufficiency\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Pulmonary toxicity:",
"        </strong>",
"        A variety of manifestations of pulmonary toxicity have been reported with gemcitabine",
"        <sup>",
"         [2]",
"        </sup>",
"        . Discontinue gemcitabine immediately and permanently. Refer to UpToDate topic on \"Pulmonary toxicity associated with antineoplastic therapy: Cytotoxic agents\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Other toxicity:",
"        </strong>",
"        For severe (grade 3 or 4) non-hematologic toxicities, gemcitabine should be held or decreased by 50 percent based on clinical judgement",
"        <sup>",
"         [1]",
"        </sup>",
"        . Discontinue bevacizumab for hypertensive crisis or hypertensive encephalopathy, serious (&ge;grade 2) hemorrhage, arterial thromboembolism, nephrotic syndrome, gastrointestinal perforation, fistula formation, or reversible posterior leukoencephalopathy syndrome (RPLS), severe venous thromboembolism, and severe heart failure",
"        <sup>",
"         [1,4]",
"        </sup>",
"        . Do not administer bevacizumab within 28 days of surgery or until wounds are fully healed",
"        <sup>",
"         [4]",
"        </sup>",
"        .",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"4\">",
"        <strong>",
"         If there is a change in body weight of at least 10 percent, doses should be recalculated.",
"        </strong>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <strong>",
"     This table is provided as an example of how to administer this regimen; there may be other acceptable methods. This regimen must be administered by a clinician trained in the use of chemotherapy. The clinician is expected to use his or her independent medical judgment in the context of individual circumstances to make adjustments, as necessary.",
"    </strong>",
"    <div class=\"footnotes\">",
"     IV: intravenous; G-CSF: granulocyte-colony stimulating factors; CBC: complete blood count; ANC: absolute neutrophil count.",
"     <br/>",
"     * AUC (area under the dose-concentration x time curve) is converted to a patient-specific carboplatin dose (in mg) according to renal function by using the Calvert formula. The Calvert formula is total dose (mg) = (target AUC) x (GFR + 25). If using measured serum creatinine, limit the maximal GFR for the calculation to 125 mL/min. Refer to UpToDate topic on \"Chemotherapy-related nephrotoxicity and dose modification in patients with renal insufficiency\".",
"     <br/>",
"     &Delta; Diluent solutions should not be modified without consulting a detailed reference due to potential incompatibility(ies).",
"     <br/>",
"     <span class=\"lozenge\">",
"      &loz;",
"     </span>",
"     Do not administer or mix bevacizumab with dextrose solutions.",
"    </div>",
"    <div class=\"reference\">",
"     References:",
"     <br/>",
"     <ol>",
"      <li>",
"       Aghajanian C, et al. J Clin Oncol 2012; 30:2039.",
"      </li>",
"      <li>",
"       Gemzar (gemcitabine hydrochloride) injection. US FDA-approved manufacturer's package insert. US National Library of Medicine. (Available online at file://dailymed.nlm.nih.gov, accessed November 16, 2012).",
"      </li>",
"      <li>",
"       An MM, et al. Eur J Clin Pharmacol 2010; 66:813.",
"      </li>",
"      <li>",
"       Avastin (bevacizumab) injection. US FDA-approved manufacturer's package insert. US National Library of Medicine. (Available online at file://dailymed.nlm.nih.gov, accessed November 16, 2012).",
"      </li>",
"     </ol>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
